export const getAsset: "\n  query GetAsset($id: ID!) {\n    getAsset(id: $id) {\n      id\n      node_id\n      createdAt\n      type\n      name\n      owner\n      content\n      editors\n      updatedAt\n    }\n  }\n";
export const listAssets: "\n  query ListAssets(\n    $filter: ModelAssetFilterInput\n    $limit: Int\n    $nextToken: String\n  ) {\n    listAssets(filter: $filter, limit: $limit, nextToken: $nextToken) {\n      items {\n        id\n        node_id\n        createdAt\n        type\n        name\n        owner\n        content\n        editors\n        updatedAt\n      }\n      nextToken\n    }\n  }\n";
